before_you_leave:
['Additional requests - Check out is at 11am. Should you check out earlier please let us know. Please help us prepare for the next guest by:
1) Placing remote controls upside down on the window sill to charge;
2) Placing non recyclable items into the black garbage bin and recycling items into the blue recycling bin located outside;
3) Open curtains to allow the plants to continue growing and purifying the air we breathe.']

